import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { store } from './redux/store';
import { Provider } from 'react-redux';
import { PlaceContext } from './context/PlaceContext';
import { HotelsContext } from './context/HotelsContext';
import { place, setPlace, loading, setLoading } from './context/PlaceContext';
import {hotels,setHotels,
addHotels,
selectedHotel,
setSelectedHotel} from './context/PlaceContext';

const value = {state, dispatch}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <PlaceContext.Provider value={place, setPlace, loading, setLoading}>
      <Provider store={store}>
        <HotelsContext.Provider value={value}>
          <App />
        </HotelsContext.Provider>
      </Provider>
    </PlaceContext.Provider>
